import logo from "./logo.svg";
import "./App.css";
import React, { Component } from "react";

class Head extends Component {
  render() {
    return (
      <header>
        <h1>Hello</h1>
      </header>
    );
  }
}

class Nav extends Component {
  render() {
    return (
      <nav>
        <ul>
          <li>1. naver</li>
          <li>2. kakao</li>
          <li>3. coupang</li>
        </ul>
      </nav>
    );
  }
}

class Foot extends Component {
  render() {
    return <footer>chb09876@naver.com</footer>;
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Head></Head>
        <Nav></Nav>
      </div>
    );
  }
}

export default App;
